import {Link} from 'react-router-dom';

function Breadcrumb( {items} ){

	return(
		<nav className="breadcrumb breadcrumb-gray">


            {
                items && items.map( (item, index) => {


                        <Link to={item.link} >{item.name}</Link>

                    }   

                ) 
            }

            {/*<Link to="/" >Чистопар</Link>
